import { useState } from "react";

/* ===== MAP PARAMS (map.yaml과 맞춰야 함) ===== */
const GRID_SIZE = 40;        // px
const RESOLUTION = 0.05;     // m / px
const ORIGIN = { x: -5, y: -5 };

const MAP_SIZE = 800;
const GRID_COUNT = MAP_SIZE / GRID_SIZE;

/* ===== 좌표 변환 ===== */
const gridToWorld = (gx, gy) => ({
  x: gx * GRID_SIZE * RESOLUTION + ORIGIN.x,
  y: gy * GRID_SIZE * RESOLUTION + ORIGIN.y
});

/* ===== Map Canvas ===== */
function MapCanvas({ onGridClick, placeBuffer }) {
  const handleClick = (e) => {
    const rect = e.currentTarget.getBoundingClientRect();
    const px = e.clientX - rect.left;
    const py = e.clientY - rect.top;

    const gx = Math.floor(px / GRID_SIZE);
    const gy = Math.floor(py / GRID_SIZE);

    onGridClick(gx, gy);
  };

  return (
    <div
      onClick={handleClick}
      style={{
        width: MAP_SIZE,
        height: MAP_SIZE,
        backgroundImage: "url('/map.png')",
        backgroundSize: "cover",
        position: "relative",
        border: "1px solid black"
      }}
    >
      {/* grid lines */}
      {[...Array(GRID_COUNT)].map((_, i) => (
        <div key={`v-${i}`} style={{
          position: "absolute",
          left: i * GRID_SIZE,
          top: 0,
          width: 1,
          height: "100%",
          background: "rgba(0,0,0,0.15)"
        }} />
      ))}
      {[...Array(GRID_COUNT)].map((_, i) => (
        <div key={`h-${i}`} style={{
          position: "absolute",
          top: i * GRID_SIZE,
          left: 0,
          height: 1,
          width: "100%",
          background: "rgba(0,0,0,0.15)"
        }} />
      ))}

      {/* selected place grids */}
      {placeBuffer.map((g, idx) => (
        <div
          key={idx}
          style={{
            position: "absolute",
            left: g.gx * GRID_SIZE,
            top: g.gy * GRID_SIZE,
            width: GRID_SIZE,
            height: GRID_SIZE,
            background: "rgba(255,0,0,0.3)"
          }}
        />
      ))}
    </div>
  );
}

/* ===== MAIN APP ===== */
export default function App() {
  const [mode, setMode] = useState("object");
  const [placeBuffer, setPlaceBuffer] = useState([]);

  const [semanticMap, setSemanticMap] = useState({
    objects: [],
    places: []
  });

  /* ===== grid click handler ===== */
  const handleGridClick = (gx, gy) => {
    if (mode === "object") {
      const id = prompt("object id?");
      const type = prompt("object type?");
      if (!id || !type) return;

      const pos = gridToWorld(gx, gy);

      setSemanticMap((prev) => ({
        ...prev,
        objects: [
          ...prev.objects,
          { id, type, position: pos }
        ]
      }));
    }

    if (mode === "place") {
      setPlaceBuffer((prev) => [...prev, { gx, gy }]);
    }
  };

  /* ===== place 확정 ===== */
  const finalizePlace = () => {
    if (placeBuffer.length === 0) return;

    const id = prompt("place id?");
    const type = prompt("place type?");
    if (!id || !type) return;

    const xs = placeBuffer.map(g => g.gx);
    const ys = placeBuffer.map(g => g.gy);

    const minX = Math.min(...xs);
    const maxX = Math.max(...xs) + 1;
    const minY = Math.min(...ys);
    const maxY = Math.max(...ys) + 1;

    const p1 = gridToWorld(minX, minY);
    const p2 = gridToWorld(maxX, minY);
    const p3 = gridToWorld(maxX, maxY);
    const p4 = gridToWorld(minX, maxY);

    const polygon = [
      [p1.x, p1.y],
      [p2.x, p2.y],
      [p3.x, p3.y],
      [p4.x, p4.y]
    ];

    const center = {
      x: (p1.x + p3.x) / 2,
      y: (p1.y + p3.y) / 2
    };

    setSemanticMap((prev) => ({
      ...prev,
      places: [
        ...prev.places,
        { id, type, polygon, center }
      ]
    }));

    setPlaceBuffer([]);
  };

  /* ===== JSON 저장 ===== */
  const saveJSON = () => {
    const blob = new Blob(
      [JSON.stringify(semanticMap, null, 2)],
      { type: "application/json" }
    );
    const url = URL.createObjectURL(blob);
    const a = document.createElement("a");
    a.href = url;
    a.download = "semantic_map.json";
    a.click();
    URL.revokeObjectURL(url);
  };

  return (
    <div style={{ display: "flex" }}>
      <MapCanvas
        onGridClick={handleGridClick}
        placeBuffer={placeBuffer}
      />

      <div style={{ marginLeft: 20, width: 420 }}>
        <h3>Mode</h3>
        <button onClick={() => setMode("object")}>Object</button>
        <button onClick={() => setMode("place")}>Place</button>
        <button onClick={finalizePlace}>Finalize Place</button>
        <button onClick={saveJSON}>Save JSON</button>

        <h3>Semantic JSON</h3>
        <pre style={{ height: 600, overflow: "auto" }}>
          {JSON.stringify(semanticMap, null, 2)}
        </pre>
      </div>
    </div>
  );
}
